    [],nt"revision_timestamp": "2016-07-27T22:41:29.379235",nt"name": "histological-staging-and-determination-of-the-plasma-17-beta-estradiol-testosterone-and-vi",nt"isopen":
    false,nt"url": null,nt"notes": "This report describes the methods and results
    of the analyses of reproductive biomarkers in the white sucker collected from Distinct
    Population Segment (DPS) Atlantic salmon rivers in Maine. White suckers were collected
    from six rivers (Cove Brook, Ducktrap River, East Michias River, Michias River,
    Narraguagus River, and Sheepscot River) designated as DPS for the endangered Atlantic
    salmon. 17u03b2-estradiol, testosterone, and vitellogenin concentrations were measured
    in plasma samples to examine xenoestrogen exposure and histological analysis was
    conducted on the gonads to determine sex and reproductive stage. This information
    will be used to evaluate if contaminant exposure occurs in these rivers.",nt"license_title":
